CITY iLOVE is the customer loyalty application of the Baneasa Shopping City shopping center.
The application brings you exclusive benefits and discounts in the partner stores in Baneasa Shopping City. Moreover, you can book cinema tickets or pay your parking spot with just a few clicks.
Download the application and be part of the CITY iLOVE community!

What does CITY iLOVE offer you?
Scan receipts, collect points and enjoy the benefits:
- Cumulative discounts of up to 50%, in over 70 stores;
- Reserve your parking spot at the entrance of the mall through the Smart Parking option;
- Pay for parking directly from your phone, avoid the jukebox queue and you can enjoy free parking hours;
- Reserve cinema tickets.

More details and the application regulations can be found on https://www.baneasa.ro/cityilove.
